import axios from 'axios';

function App() {

  return (
       <div class="main_container">
       <div class="hero">
       <div class="header">
        <div class="left">
          <p>Sanchari</p>
        </div>
        <div class="right">
        <p><a href="#Experience">Experiences</a></p>
        <p><a href="#Popular">PopularPlaces</a></p>
        <p><a href="#Bucketlist">BucketList</a></p>
        </div>
      </div>
